import React, { Component } from "react";
import {Container, Row, Col} from "../"



class TextEditor extends Component {
    render() {
        return (
            <>
            <Container fluid>
                <Row>
                    <BlockPreview />
                    <BlockPreview />
                    <BlockPreview />
                    <BlockPreview />
                    <BlockPreview />
                </Row>

            
            </Container>
            </>
        )
    }
}

export default TextEditor;
